void cnn1(float input[28][28],float weights[6][9],float b_conv1[6],float output[6][26][26])
{

	float conv_buf[9]={0};


	for(int k=0;k<6;k++)
	{
		for(int i=1;i<27;i++)
		{

			for(int j=1;j<27;j++)
			{
				conv_buf[0] = input[i-1][j-1] * weights[k][0];
				conv_buf[1] = input[i-1][j]   * weights[k][1];
				conv_buf[2] = input[i-1][j+1] * weights[k][2];
				conv_buf[3] = input[i][j-1]   * weights[k][3];
				conv_buf[4] = input[i][j]     * weights[k][4];
				conv_buf[5] = input[i][j+1]   * weights[k][5];
				conv_buf[6] = input[i+1][j-1] * weights[k][6];
				conv_buf[7] = input[i+1][j]   * weights[k][7];
				conv_buf[8] = input[i+1][j+1] * weights[k][8];
				for(int x=0;x<9;x++)
					output[k][i-1][j-1] = output[k][i-1][j-1] + conv_buf[x];

				output[k][i-1][j-1] = output[k][i-1][j-1] + b_conv1[k];

			}


		}


	}
}



void cnn2(float input[6][13][13],float weights[8][6][9],float b_conv2[8],float output[8][11][11])
{

	float conv_buf[9]={0};

	//number of output layer
	for(int k=0;k<8;k++)
	{
		//number of output columns
		for(int i=1;i<12;i++)
		{
			//number of output rows
			for(int j=1;j<12;j++)
			{

				//number of input layers
				for(int fm=0;fm<6;fm++)
				{
					conv_buf[0] = input[fm][i-1][j-1] * weights[k][fm][0];
					conv_buf[1] = input[fm][i-1][j]   * weights[k][fm][1];
					conv_buf[2] = input[fm][i-1][j+1] * weights[k][fm][2];
					conv_buf[3] = input[fm][i][j-1]   * weights[k][fm][3];
					conv_buf[4] = input[fm][i][j]     * weights[k][fm][4];
					conv_buf[5] = input[fm][i][j+1]   * weights[k][fm][5];
					conv_buf[6] = input[fm][i+1][j-1] * weights[k][fm][6];
					conv_buf[7] = input[fm][i+1][j]   * weights[k][fm][7];
					conv_buf[8] = input[fm][i+1][j+1] * weights[k][fm][8];
					for(int x=0;x<9;x++)
						output[k][i-1][j-1] = output[k][i-1][j-1] + conv_buf[x];

				}
				output[k][i-1][j-1] = output[k][i-1][j-1] +  b_conv2[k];

			}


		}



	}
}

void pool1(float input[6][26][26],float output[6][13][13] )
{
	int cnti=0;
	int cntj=0;
	for(int k=0;k<6;k++)
	{
		cnti=0;
		for(int i=1;i<26;i=i+2)
		{
			cntj=0;
			for(int j=1;j<26;j=j+2)
			{

				output[k][cnti][cntj] = fmax( fmax(input[k][i][j],input[k][i][j-1]) , fmax(input[k][i-1][j],input[k][i-1][j-1]));
				cntj++;
			}
			cnti++;

		}

	}

}



void pool2(float input[8][11][11],float output[8][10][10] )
{

	for(int k=0;k<8;k++)
	{

		for(int i=1;i<11;i++)
		{

			for(int j=1;j<11;j++)
			{

				output[k][i-1][j-1] = fmax( fmax(input[k][i][j],input[k][i][j-1]) , fmax(input[k][i-1][j],input[k][i-1][j-1]));

			}


		}

	}

}


void relu1(float input[6][13][13],float output[6][13][13])
{
	for(int k=0;k<6;k++)
	{
		for(int i=0;i<13;i++)
		{
			for(int j=0;j<13;j++)
			{
				if(input[k][i][j]>0)
					output[k][i][j] = input[k][i][j];
				else
					output[k][i][j] = 0.1*input[k][i][j];

			}
		}
	}

}

void relu2(float input[8][10][10],float output[8][10][10])
{
	for(int k=0;k<8;k++)
	{
		for(int i=0;i<10;i++)
		{
			for(int j=0;j<10;j++)
			{
				if(input[k][i][j]>0)
					output[k][i][j] = input[k][i][j]/4096;
				else
					output[k][i][j] = 0.1*input[k][i][j]/4096;
			}
		}
	}
}



void reshape_flat(float input[8][10][10],float output[800])
{
	int cnt=0;

	for(int i=0;i<10;i++)
	{
		for(int j=0;j<10;j++)
		{
			for(int k=0;k<8;k++)
			{
				output[cnt] = input[k][i][j];
				cnt= cnt+1;
			}
		}
	}
}

void full_connect(float input[800],float fc_in[800][10],float b_fc[10],float output[10])
{

	for(int i=0;i<10;i++)
	{
		for(int j=0;j<800;j++)
		{
			output[i] = (output[i] + input[j]*fc_in[j][i]);
		}

		output[i] = output[i] + b_fc[i];

	}

	for(int a=0;a<10;a++)
	{
		output[a] = output[a]/4096;
	}


}

void softmax(float input[10],float output[10])
{

//	A = exp(A - max(A));
//	A = A/sum(A);

	float sum=0;
	float max=0;

	for(int i=0;i<10;i++)
	{
		if(input[i]> max)
			max = input[i];
	}


	//
	for(int a=0;a<10;a++)
		input[a] = exp(input[a] - max);


	for(int b=0;b<10;b++)
		sum = sum+input[b];


	for(int c=0;c<10;c++)
		output[c] = input[c]/sum;
}



void resize_img(signed short int ori_image[252][252], float image[28][28])
{
	int cnt=0;
	for(int i=0;i<28;i++)
		{
			for(int j=0;j<28;j++)
			{
				cnt=0;
				for(int k=0;k<9;k++)
				{
					for(int l=0;l<9;l++)
					{
						cnt=cnt+ori_image[9*i+k][9*j+l];
					}
				}
				image[i][j]=cnt/81;
			}
		}

}


void char2img(unsigned char ori_image[28][28],float img[28][28])
{
	int j=0;
	int k=0;
	for(k=0;k<28;k++)
		for(j=0;j<28;j++)
			img[k][j] = 0 + ori_image[k][j];
}

float softmax_out[10]={0};

signed short int mnist(unsigned char ori_image[28][28])
{




	signed short int result=0;
	int i=0;
	int j=0;
	int k=0;

	char2img(ori_image,img);


	cnn1(img, weights, b_conv1, output1);

	pool1(output1,poolout);

	relu1(poolout,reluout);



	cnn2(reluout,weights2,b_conv2,output2);

	pool2(output2,poolout2);

	relu2(poolout2,reluout2);


	reshape_flat(reluout2,reshape);

	full_connect(reshape,w_fc,b_fc,fc_out);

	softmax(fc_out,softmax_out);


	for ( i=0;i<10;i++){
		if(softmax_out[i]==1)
			result = i;
	}

	for( i=0;i<28;i++)
		for( j=0;j<28;j++)
			img[i][j]=0;

	for( i=0;i<6;i++)
		for( j=0;j<26;j++)
			for( k=0;k<26;k++)
				output1[i][j][k]=0;

	for( i=0;i<6;i++)
		for( j=0;j<13;j++)
			for( k=0;k<13;k++)
				poolout[i][j][k]=0;

	for( i=0;i<6;i++)
		for( j=0;j<13;j++)
			for( k=0;k<13;k++)
				reluout[i][j][k]=0;

	for( i=0;i<8;i++)
		for( j=0;j<11;j++)
			for( k=0;k<11;k++)
				output2[i][j][k]=0;
	for( i=0;i<8;i++)
		for( j=0;j<10;j++)
			for( k=0;k<10;k++)
				poolout2[i][j][k]=0;

	for( i=0;i<8;i++)
		for( j=0;j<10;j++)
			for( k=0;k<10;k++)
				reluout2[i][j][k]=0;

	for( i=0;i<800;i++)
		reshape[i]=0;


	for( i=0;i<10;i++)
		fc_out[i]=0;

	for( i=0;i<10;i++)
		softmax_out[i]=0;

	return result;
}


